import MainLayout from '../components/layouts/mainLayout'

class Contact extends Component{
  constructor(props){
    super(props)
  }

  render(){
    return(
      <>
      <MainLayout>
      <h2>welcone to contact page</h2>
      </MainLayout>
      </>
    )
  }
}

export default Contact;
